import React, { useEffect } from "react";
import { connect } from "react-redux";

import BoxContainer from "../../components/Elements/BoxContainer/BoxContainer";
import LayoutPage from "../../hoc/LayoutPage/LayoutPage";

const PAGE_NAME = "Home";

function HomeAdmin() {
    return (
        <BoxContainer icon="reconciliation" mode="dark">
            <div className={styles.casual_title}>
                Are You Owner of Sports Venue?
            </div>
            <div className={styles.casual_description}>
                Help people do more sports and bring as many people to your
                venue. Give the best services for venue rental and earn
                popularity
            </div>
            <Button ghost onClick={redirectToLandingPageAdmin}>
                Let's Go
            </Button>
        </BoxContainer>
    );
}

const mapStateToProps = state => {
    return {};
};

const mapDispatchToProps = dispatch => {
    return {};
};

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(LayoutPage(HomeAdmin, PAGE_NAME));
